INSERT INTO `articles` (`Article_ID`, `Title`, `Content`, `Journalist`, `Editor`, `Submitted`, `Approved`, `Feedback`, `Image`) VALUES
(24, 'The biggest trends you need to invest in now', 'Your best friend whatever the season, ankle boots never go out of style. These are the boots we\'re swooning over for spring... Finding the perfect pair of ankle boots is an essential shopping goal. From heels to flats and Chelsea boots to biker boots, a good pair can be styled all year-round, no matter the weather. From Celine to Topshop, the past few seasons have seen ankle boots all over the runways, while the street style set at London Fashion Week loves to team floaty dresses with tough, androgynous combat styles, or leggings tucked into white boots and finished with an oversized knit.', 1, 2, 1, '0', 'too!short!', NULL),
(25, 'How Royal Woman Shaped Fashion', 'There is it seems no stopping the so-called ‘Meghan effect’ – the phenomenon where every item of clothing Meghan Markle wears immediately sells out. The white coat by Canadian brand Line, worn by Prince Harry’s soon-to-be bride for the couple’s engagement announcement, proved so popular that the company’s website crashed – soon after, the brand officially named the coat ‘the Meghan’. Meanwhile, traffic to the website of jewellery brand Birks increased 400 per cent, and even a simple black jumper from Marks and Spencer sold out twice after Markle wore it for a public engagement. And this is even before any sign of the bride’s choice of wedding dress, already sparking febrile speculation in fashion circles, and, needless to say, sure to lead to new bridal trends.The phenomenon of royal women influencing fashion is nothing new, of course. Look no further than the ‘Kate effect’ still being wrought by the Duchess of Cambridge, not to mention the ‘Diana effect’ in the 1980s and 90s. But what is perhaps less known is quite how influential the personal styles of certain royal women were – long before the invention of the internet, or any mass media for that matter. So what does it take to be a royal style icon? And how different – or not – was it then from now?', 1, 2, 1, '1', NULL, NULL),
(26, 'The changing face of Bridal Wear', 'Of course, the white (or ivory) wedding dress popularised by Queen Victoria has certainly endured, and there’s no denying its totemic power. For many brides it encapsulates a hopeful, romantic nostalgia. “It can have a transformative effect,” says senior curator at the Victoria and Albert Museum, Edwina Ehrman, who has studied how wedding dresses have changed in tune with fashion and society over the centuries. “And if you’ve already been living with your partner or even if you’ve had children you may want to wear white at your wedding .......', 1, NULL, 0, '0', NULL, NULL),
(27, 'Is this the end for real fur?', 'London Fashion Week recently became the first global fashion week to ban animal fur. Campaigners were euphoric. In the past year, fur has faced significant challenges everywhere, but still – it was quite a moment. Then, a few weeks later, Los Angeles voted to ban the manufacture and sale of fur within city limits, becoming the largest American city to do so. Has fur – fashion’s most controversial material – finally had its day?', 6, NULL, 1, '0', NULL, NULL),
(28, 'Tennis, after a Fashion', 'At a glance, many may believe that sports courts are far from the ramp. Reality shows that sports and games which started as a recreational or social event, had an influential effect on fashion.\r\n\r\n \r\n\r\nThe dress worn by men and women during these events were linked to their social status and traditional values. As sports became popular and accessible to most people belonging to various social segments and strata, the fashion associated with the sport also evolved.\r\n\r\n \r\n\r\nFashion in tennis\r\n\r\nTennis is associated with British aristocracy and it gradually spread to various other countries with British occupation. Then, it went further. Currently, there are four Grand Prix championships conducted for tennis: Wimbledon, US Open, French Open and Australian Open. Apparel, both off and on court, in the various tournaments has always grabbed the attention of the game\'s fans on one side and fashionistas on the other.', 6, 5, 1, '1', NULL, NULL),
(29, 'Street Style for kids', 'One look at photographs of Harper Beckham, Suri Cruise or Dannielynn Birkhead who modelled for Guess and you know that street fashion is not a passing fad. Children, as much as youth, breathe it.\r\nStreet style for kids is big business today. Funky, quirky and jazzed up with glamour accessories team up with the carefully casual look for girls and boys.\r\nStreet style has always been there. It is only since the mid-1950s that its importance has been recognised, appreciated and emulated. Street fashion is considered to have emerged not from studios, but from the grassroots. It is generally linked with youth culture, and is often seen in major urban centres even though smaller towns have their own smaller hubs.', 6, 5, 1, '0', 'addPicture', NULL);
INSERT INTO `articles` (`Article_ID`, `Title`, `Content`, `Journalist`, `Editor`, `Submitted`, `Approved`, `Feedback`, `Image`) VALUES
(30, '7 Fashion Trends to Be Thankful for This Year', 'This is shaping up to be a pretty bad year for pretty much everything. In these dark times, take a bit of solace in the fact that the fashion world is offering some surprisingly lovely trends. From enormous, colorful dresses to actually comfortable shoes, the once elitist, stilettos-only world of high style is becoming more egalitarian, and more accessible, than ever before. And in this new, democratized world of style the biggest rule is that there are no rules. You can wear a princess gown with sneakers! A bath robe to an evening event! Even slippers to the office! Your gym clothes are now your work clothes and your party outfits are your weekday pick-me-ups. Everythingï¿½s topsy turvy and thatï¿½s not all that bad.\r\n\r\nSo, for those looking for something to be thankful for this Thanksgiving, we present 8 of-the-moment trends that will make our lives easierï¿½and chicerï¿½for the rest of 2017 and beyond.', 1, NULL, 1, '0', NULL, );
INSERT INTO `articles` (`Article_ID`, `Title`, `Content`, `Journalist`, `Editor`, `Submitted`, `Approved`, `Feedback`, `Image`) VALUES
(31, 'Your Puffy Coat Is Too Puffy\r\n', 'AT SOME POINT every winter, on one of those 20-degree mornings here in New York, I envy George Costanza. To be more exact, I envy one particular coat worn by the “Seinfeld” grump (I’ll keep my full head of hair, thank you very much). In “The Dinner Party,” an episode in the sitcom’s fifth season, Jason Alexander’s curmudgeonly character waddles into Jerry’s apartment in a poofy black Gore-Tex jacket. Elaine (Julia Louis-Dreyfus) calls him “bubble boy,” yet George is unperturbed. It’s cold, and his feathery cocoon is toasty. “You wish you had this coat!” he spits back. And I must admit, I do.\r\n', 6, NULL, 0, '0', NULL, NULL);

